import React from "react";
import { Paper } from "@mui/material";
import Calendar from "react-calendar";
import "react-calendar/dist/Calendar.css";
import "../styles/CalendarStyles.css"; //  拽抓 CSS 转 砖转 (爪专 转 砖)

const CalendarWidget = ({ selectedDate, setSelectedDate }) => {
  return (
    <Paper
      sx={{
        flex: 1,
        height: "550px", //   拽注 砖转 砖转
        margin: "10px",
        padding: "10px",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.2)", //  爪 驻
        borderRadius: "10px", //  驻转 注转
      }}
    >
      <Calendar
        onChange={setSelectedDate}
        value={selectedDate}
        className="modern-calendar" //  拽 转转 砖转 注爪
      />
    </Paper>
  );
};

export default CalendarWidget;
